import axios from "axios";
import authHeader from "./auth-header";

const API_URL = "https://localhost:7108/api/CloudManagement/";

const getVmList = () => {
  return axios.get(API_URL + "GetVmList", { headers: authHeader() });
};

const deactivateMachine = (requestObject) => {
  return axios.post(API_URL + "StopSelectedVm", { InstanceName: requestObject.instanceName, Zone: requestObject.zone }, { headers: authHeader() });
};

const activateMachine = (instanceName, zone) => {
  return axios.post(API_URL + "StartSelectedVm", { InstanceName: instanceName, Zone: zone }, { headers: authHeader() });
};

export default {
  getVmList,
  deactivateMachine,
  activateMachine,
};
